class Vector {

    constructor(x, y) {
        this.x = x
        this.y = y
    }

    static add(v, w) {
        return [v[0] + w[0], v[1] + w[1]]
    }

    static negative(v) {
        return [-v[0], -v[1]]
    }

    static subtract(v, w) {
        return this.add(v, this.negative(w))
    }

    static multiply(a, v) {
        return new this(a * v[0], a * v[1])
    }

}

export default Vector
